【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 小型・軽量で取り回しがラク、高トルク470N・mで大型ボルトの仮締めがラクラク。<br /><br />★ パワーを絞り出すダブルハンマー方式。新開発ダブルハンマーブロックの採用により、470N・mの高トルクでも小型・軽量化を実現。<br /><br />★ 電池切れ防止をサポート、電池残容量表示機能付。<br /><br />★ リテーナリング(Cバネ)でソケット交換がスムーズ。ソケットが仮保持できるのでピンを差し込むのが簡単。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* 差込角: 12.7(ピンタイプ)<br />* 最大締付トルク(正逆同トルク): 470N・m{4.790Kgf・cm}《□12.7ピンタイプソケット使用時》<br />* 回転数: 0~1.550回転/分<br />* 打撃数: 0~2.400回/分<br />* 振動3軸合成値: 14.9m/s2<br />* 保護等級: IP56<br />* 電池パック: 電圧: DC18V、LSタイプ(容量4.2Ah・リチウムイオン)<br />* 付属品: EZ9644 プラスチックケース、EZ0L81 急速充電器(リチウムイオン専用)、EZ9L51 電池パックLSタイプ(18V)(2個)</p></div><!-- 商品仕様 ここまで --><!-- 共通説明文（大）-->
